export const getProceduresIconById = (id: string): ProceduresIconEntry | undefined => {
  return PROCEDURES_ICON_CATALOG.find(icon => icon.id === id);
}

export const getProceduresIconCategories = (): string[] => {
  const categories = new Set<string>();
  PROCEDURES_ICON_CATALOG.forEach(icon => {
    categories.add(icon.category);
  });
  return Array.from(categories).sort();
}

// Statistics per category
export const getIconStats = () => {
  const stats: Record<string, number> = {};
  PROCEDURES_ICON_CATALOG.forEach(icon => {
    stats[icon.category] = (stats[icon.category] || 0) + 1;
  });
  return stats;
}
